var timer;


function updateScroller() {
    timer = setInterval(() => {
        scroller.update();
    }, 15);
    setTimeout(() => {
        clearInterval(timer);
    }, 350);

}

function SendDataToSheet(sheetLink, formClassName, headingText, contentText) {
    var link = sheetLink;
    const form = document.getElementsByClassName(formClassName);

    fetch(link, {
        method: 'POST',
        body: new FormData(form[0])
    }).then(
        DisplayMsg(0, headingText, contentText, 4000, 'b'),
        SetSubscribeCookie()
    )

}

